import { BrowserRouter, Route, Router } from "react-router-dom";
import { Nav , Youself , Card , Home} from "./components/index";
function App() {
  return (
    <>
    <BrowserRouter>
      <Router>
        <Route  path='/' element={<Home/>} />
      </Router>
    </BrowserRouter>
    </>
  );
}

export default App;
